import React from 'react';
import './App.css';
import Navbar from './components/navbar';
import { BrowserRouter as Router, Switch,
Route } from 'react-router-dom';
import './App.css';
import HeroSection from '../HeroSection';

function Home () {
  return (
    <Router>
      <Navbar />
        <Switch>
          <Route path='/' exact component={Home} />
        </Switch>
    </Router>
    );
}

export default Home;
